// import logo from './logo.svg';
import "./App.css";

function App() {
	class Category {
		constructor(id, title) {
			this.id = id;
			this.title = title;
		}
	}
	const hats = new Category(1, "hats");
	const jackets = new Category(2, "jackets");
	const shoes = new Category(3, "shoes");
	const womens = new Category(3, "womens");
	const mens = new Category(3, "mens");

	const categories = [hats, jackets, shoes, womens, mens];

	return (
		<div className="App">
			<div className="categories-container">
				{categories.map((category) => (
					<div key={category.id}>
						<h2>{category.title.toUpperCase()}</h2>
						<p>Shop Now</p>
					</div>
				))}
			</div>
		</div>
	);
}

export default App;
